# -*- coding: utf-8 -*-
import unittest
import sys
sys.path.append("..")
from sparqlcuisinequery import fictional_universe_query, cuisine_query, get_results

class sparqlcuisinequeryTest(unittest.TestCase):
    
    def test_cuisinequery_contains(self):
        
        japan_country_id = "Q17"
        

        
        dish_list = cuisine_query(japan_country_id)
        
        self.assertTrue("sushi" in dish_list)

        self.assertFalse("spotted dick" in dish_list)

        
    def test_cuisine_query_matches(self):
                
        israel_country_id = "Q801"
        
        dish_list = cuisine_query(israel_country_id)
        
        actual_dish_list = ['Cholent', 'malawach', 'Bagel toast', 'Sabich', 'Cow Chocolate', 'Jerusalem mixed grill', 'Vodka Perfect', 'Kichel', 'Ktzitzot Khubeza', 'Ziva', 'Bourekas']
        
        
        self.assertEqual(actual_dish_list, dish_list)
        
    def test_universe_contains(self):
        
        DC_universe_id = "Q1152150"
        
        universe_list = fictional_universe_query(DC_universe_id)
        
        self.assertTrue("Batman" in universe_list)
        
        self.assertFalse("Ironman" in universe_list)

